    def test_index(self):
        '''
        '''
        with HTTMock(self.response_content):
            index = self.client.get('/')
            self.assertEqual(index.status_code, 200)
            self.assertIn('Precog', index.data)
    
    def test_redirect_default_branch(self):
        '''
        '''
        with HTTMock(self.response_content):
            blog1 = self.client.get('/mapzen/blog')
            self.assertIn(blog1.status_code, (301, 302))

            redirect1 = urlparse(blog1.headers['Location'])
            self.assertEqual(redirect1.path, '/mapzen/blog/master/')

            blog2 = self.client.get('/mapzen/blog/')
            self.assertIn(blog2.status_code, (301, 302))

            redirect2 = urlparse(blog2.headers['Location'])
            self.assertEqual(redirect2.path, '/mapzen/blog/master/')
    
    def test_redirect_addslash(self):
        '''
        '''
        with HTTMock(self.response_content):
            root = self.client.get('/mapzen/blog/master')
            self.assertIn(root.status_code, (301, 302))

            redirect = urlparse(root.headers['Location'])
            self.assertEqual(redirect.path, '/mapzen/blog/master/')
    
    def test_site_index(self):
        '''
        '''
        with HTTMock(self.response_content):
            index = self.client.get('/mapzen/blog/master/')
            self.assertEqual(index.status_code, 200)
            self.assertIn('Mapzen', index.data)

